INSERT INTO `messages` (`id`, `reply_id`, `ticket_id`, `message`, `message_id`, `created_by_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, NULL, 1, 'My personal information is showing up incorrectly in the app (name, contact details). Iâ€™ve verified the data I entered and everything appears correct on my side. I suspect this could be an issue with how it was processed, but the system doesnâ€™t seem to be at fault. Please assist in fixing the display of my information.', NULL, 1, '2025-01-28 00:24:06', '2025-01-28 00:24:06', NULL),
(2, NULL, 2, 'Hello,\r\nI recently completed a ride with your service (Ride ID: 1234589) from 456 Elm St to 789 Oak Rd. After arriving at my destination, I realized I accidentally left my phone in the backseat of the car. Iâ€™ve retraced my steps but couldnâ€™t find it, and Iâ€™m hoping you can help me recover it.\r\n\r\nCould you please assist by checking with the driver to see if the phone was found in the vehicle? The phone is a black iPhone 13 with a blue case. If the driver has it, I would be happy to arrange a time for pickup or discuss the best way to have it returned.\r\n\r\nThank you so much for your help!\r\n\r\nBest regards,\r\nJohn', NULL, 1, '2025-01-28 00:28:38', '2025-01-28 00:28:38', NULL),
(3, NULL, 3, 'Hi,\r\nI recently took a ride (Ride ID: 100019) from 321 Maple St to 654 Pine St. However, I noticed that I was charged more than expected. The fare shown on the app before the ride started was $15, but I was billed $22. Iâ€™ve checked my route and the estimated time, and everything seems to match up, so Iâ€™m unsure why there was an extra charge.\r\n\r\nCould you please review my ride details and let me know if there was a mistake in the fare calculation? I would appreciate it if the overcharge could be corrected.', NULL, 1, '2025-01-28 00:31:15', '2025-01-28 00:31:15', NULL),
(4, NULL, 4, '.', NULL, 31, '2025-01-28 02:03:24', '2025-01-28 02:03:24', NULL),
(5, NULL, 5, '.', NULL, 31, '2025-01-28 02:03:32', '2025-01-28 02:03:32', NULL),
(6, NULL, 6, 'Jd', NULL, 43, '2025-01-28 02:07:12', '2025-01-28 02:07:12', NULL);
