(1, '{\"en\":\"Privacy Policy\",\"ar\":\"Ø³ÙŠØ§Ø³Ø© Ø§Ù„Ø®ØµÙˆØµÙŠØ©\",\"de\":\"Privacy PolicyDatenschutzrichtlinie\",\"fr\":\"Politique de confidentialitÃ©\"}', 'privacy-policy', '{\"en\":\"<p><strong>Privacy Policy for Cab Management Service</strong></p>\\r\\n<p><strong>Information Collection and Use</strong></p>\\r\\n<p>We collect personal information to provide, personalize, and improve our cab services. This information may include:</p>\\r\\n<ul>\\r\\n<li><strong>Personal Information</strong>: Name, email address, phone number, postal address, and any other details you choose to provide.</li>\\r\\n<li><strong>Payment Information</strong>: Credit card numbers, billing address, and payment history for processing your rides.</li>\\r\\n<li><strong>Location Information</strong>: Your current location, including pick-up and drop-off points, to facilitate ride matching and navigation.</li>\\r\\n<li><strong>Usage Data</strong>: IP address, device type, browser type, and app usage data to analyze and improve user experience.</li>\\r\\n<li><strong>Ride Information</strong>: Details of your trips, such as start and end locations, ride duration, driver information, and ratings.</li>\\r\\n</ul>\\r\\n<p>We use this data to:</p>\\r\\n<ul>\\r\\n<li>Communicate with you regarding your bookings, promotions, or service updates.</li>\\r\\n<li>Process payments and manage your ride requests.</li>\\r\\n<li>Improve service delivery by analyzing patterns in rides, feedback, and user behavior.</li>\\r\\n<li>Personalize your experience with tailored recommendations or services.</li>\\r\\n</ul>\\r\\n<p><strong>Data Sharing and Disclosure</strong></p>\\r\\n<p>We do not sell or rent your personal information to third parties. However, we may share your personal information with trusted third-party service providers for the purpose of delivering our services. These include:</p>\\r\\n<ul>\\r\\n<li><strong>Payment Processors</strong>: For processing payments securely.</li>\\r\\n<li><strong>Ride-Matching Systems and Navigation Providers</strong>: To enable the most efficient trip matching and route optimization.</li>\\r\\n<li><strong>Customer Support</strong>: We may use third-party tools to provide you with support services.</li>\\r\\n</ul>\\r\\n<p>All third parties we work with are contractually obligated to protect your personal information and use it only for the purposes for which it was shared.</p>\\r\\n<p>We may also disclose your information if required by law or to protect our rights, property, or safety, or the rights and safety of our users and others.</p>\\r\\n<p><strong>Data Security</strong></p>\\r\\n<p>We prioritize the security of your personal information and employ industry-standard practices to protect it from unauthorized access, disclosure, alteration, or destruction. Our security measures include:</p>\\r\\n<ul>\\r\\n<li><strong>Encryption</strong>: We use encryption to protect sensitive payment and personal data.</li>\\r\\n<li><strong>Firewalls &amp; Access Controls</strong>: To prevent unauthorized access to our systems.</li>\\r\\n<li><strong>Secure Transactions</strong>: We partner with trusted third-party payment processors to handle financial transactions securely.</li>\\r\\n</ul>\\r\\n<p>Despite these measures, please be aware that no method of transmission over the internet or electronic storage is entirely secure. While we take significant precautions to protect your data, we cannot guarantee absolute security.</p>\\r\\n<p>You are responsible for maintaining the confidentiality of your account credentials and for any activities that occur under your account.</p>\\r\\n<p><strong>Data Retention</strong></p>\\r\\n<p>We will retain your personal information only for as long as necessary to provide you with our services or as required by law. Once the information is no longer needed for the purposes outlined in this Privacy Policy, we will securely delete or anonymize it.</p>\\r\\n<p><strong>Policy Updates</strong></p>\\r\\n<p>We reserve the right to update or change our Privacy Policy at any time. Any changes will take effect immediately upon posting the revised Privacy Policy on this page. We encourage you to review this Privacy Policy periodically for any updates. Continued use of our services after any changes signifies your acceptance of those changes.</p>\\r\\n<p><strong>Contact Us</strong></p>\\r\\n<p>If you have any questions or concerns about this Privacy Policy, please contact us:</p>\\r\\n<ul>By email:&nbsp;support@pixelstrap.com</ul>\",\"ar\":\"<p><strong>Ø³ÙŠØ§Ø³Ø© Ø§Ù„Ø®ØµÙˆØµÙŠØ© Ù„Ø®Ø¯Ù…Ø© Ø¥Ø¯Ø§Ø±Ø© Ø³ÙŠØ§Ø±Ø§Øª Ø§Ù„Ø£Ø¬Ø±Ø©</strong></p>\\r\\n<p><strong>Ø¬Ù…Ø¹ Ø§Ù„Ù…Ø¹Ù„ÙˆÙ…Ø§Øª ÙˆØ§Ø³ØªØ®Ø¯Ø§Ù…Ù‡Ø§</strong></p>\\r\\n<p>Ù†Ù‚ÙˆÙ… Ø¨Ø¬Ù…Ø¹ Ø§Ù„Ù…Ø¹Ù„ÙˆÙ…Ø§Øª Ø§Ù„Ø´Ø®ØµÙŠØ© Ù„ØªÙ‚Ø¯ÙŠÙ… ÙˆØªØ®ØµÙŠØµ ÙˆØªØ­Ø³ÙŠÙ† Ø®Ø¯Ù…Ø§Øª Ø³ÙŠØ§Ø±Ø§Øª Ø§Ù„Ø£Ø¬Ø±Ø© Ù„Ø¯ÙŠÙ†Ø§. Ù‚Ø¯ ØªØ´Ù…Ù„ Ù‡Ø°Ù‡ Ø§Ù„Ù…Ø¹Ù„ÙˆÙ…Ø§Øª:</p>\\r\\n<ul>\\r\\n<li><strong>Ø§Ù„Ù…Ø¹Ù„ÙˆÙ…Ø§Øª Ø§Ù„Ø´Ø®ØµÙŠØ©</strong>: Ø§Ù„Ø§Ø³Ù…ØŒ Ø¹Ù†ÙˆØ§Ù† Ø§Ù„Ø¨Ø±ÙŠØ¯ Ø§Ù„Ø¥Ù„ÙƒØªØ±ÙˆÙ†ÙŠØŒ Ø±Ù‚Ù… Ø§Ù„Ù‡Ø§ØªÙØŒ Ø§Ù„Ø¹Ù†ÙˆØ§Ù† Ø§Ù„Ø¨Ø±ÙŠØ¯ÙŠØŒ ÙˆØ£ÙŠ ØªÙØ§ØµÙŠÙ„ Ø£Ø®Ø±Ù‰ ØªØ®ØªØ§Ø± ØªÙ‚Ø¯ÙŠÙ…Ù‡Ø§.</li>\\r\\n<li><strong>Ù…Ø¹Ù„ÙˆÙ…Ø§Øª Ø§Ù„Ø¯ÙØ¹</strong>: Ø£Ø±Ù‚Ø§Ù… Ø¨Ø·Ø§Ù‚Ø§Øª Ø§Ù„Ø§Ø¦ØªÙ…Ø§Ù†ØŒ Ø¹Ù†ÙˆØ§Ù† Ø§Ù„ÙÙˆØªØ±Ø©ØŒ ÙˆØªØ§Ø±ÙŠØ® Ø§Ù„Ø¯ÙØ¹ Ù„Ù…Ø¹Ø§Ù„Ø¬Ø© Ø±Ø­Ù„Ø§ØªÙƒ.</li>\\r\\n<li><strong>Ù…Ø¹Ù„ÙˆÙ…Ø§Øª Ø§Ù„Ù…ÙˆÙ‚Ø¹</strong>: Ù…ÙˆÙ‚Ø¹Ùƒ Ø§Ù„Ø­Ø§Ù„ÙŠØŒ Ø¨Ù…Ø§ ÙÙŠ Ø°Ù„Ùƒ Ù†Ù‚Ø§Ø· Ø§Ù„Ø§Ù„ØªÙ‚Ø§Ø· ÙˆØ§Ù„ØªÙˆØµÙŠÙ„ØŒ Ù„ØªØ³Ù‡ÙŠÙ„ Ù…Ø·Ø§Ø¨Ù‚Ø© Ø§Ù„Ø±Ø­Ù„Ø§Øª ÙˆØ§Ù„Ù…Ù„Ø§Ø­Ø©.</li>\\r\\n<li><strong>Ø¨ÙŠØ§Ù†Ø§Øª Ø§Ù„Ø§Ø³ØªØ®Ø¯Ø§Ù…</strong>: Ø¹Ù†ÙˆØ§Ù† Ø§Ù„Ù€ IPØŒ Ù†ÙˆØ¹ Ø§Ù„Ø¬Ù‡Ø§Ø²ØŒ Ù†ÙˆØ¹ Ø§Ù„Ù…ØªØµÙØ­ØŒ ÙˆØ¨ÙŠØ§Ù†Ø§Øª Ø§Ø³ØªØ®Ø¯Ø§Ù… Ø§Ù„ØªØ·Ø¨ÙŠÙ‚ Ù„ØªØ­Ù„ÙŠÙ„ ÙˆØªØ­Ø³ÙŠÙ† ØªØ¬Ø±Ø¨Ø© Ø§Ù„Ù…Ø³ØªØ®Ø¯Ù….</li>\\r\\n<li><strong>Ù…Ø¹Ù„ÙˆÙ…Ø§Øª Ø§Ù„Ø±Ø­Ù„Ø©</strong>: ØªÙØ§ØµÙŠÙ„ Ø±Ø­Ù„Ø§ØªÙƒØŒ Ù…Ø«Ù„ Ù†Ù‚Ø§Ø· Ø§Ù„Ø¨Ø¯Ø§ÙŠØ© ÙˆØ§Ù„Ù†Ù‡Ø§ÙŠØ©ØŒ Ù…Ø¯Ø© Ø§Ù„Ø±Ø­Ù„Ø©ØŒ Ù…Ø¹Ù„ÙˆÙ…Ø§Øª Ø§Ù„Ø³Ø§Ø¦Ù‚ØŒ ÙˆØ§Ù„ØªÙ‚ÙŠÙŠÙ…Ø§Øª.</li>\\r\\n</ul>\\r