Ø© Ø§Ù„Ù…Ø¹Ø¯Ù„Ø© Ø¹Ù„Ù‰ Ù‡Ø°Ù‡ Ø§Ù„ØµÙØ­Ø©. Ù†Ø´Ø¬Ø¹Ùƒ Ø¹Ù„Ù‰ Ù…Ø±Ø§Ø¬Ø¹Ø© Ø³ÙŠØ§Ø³Ø© Ø§Ù„Ø®ØµÙˆØµÙŠØ© Ù‡Ø°Ù‡ Ø¨Ø´ÙƒÙ„ Ø¯ÙˆØ±ÙŠ Ù„Ù…Ø¹Ø±ÙØ© Ø£ÙŠ ØªØ­Ø¯ÙŠØ«Ø§Øª. ÙŠØ´ÙŠØ± Ø§Ø³ØªØ®Ø¯Ø§Ù…Ùƒ Ø§Ù„Ù…Ø³ØªÙ…Ø± Ù„Ø®Ø¯Ù…Ø§ØªÙ†Ø§ Ø¨Ø¹Ø¯ Ø£ÙŠ ØªØºÙŠÙŠØ±Ø§Øª Ø¥Ù„Ù‰ Ù‚Ø¨ÙˆÙ„Ùƒ Ù„Ù‡Ø°Ù‡ Ø§Ù„ØªØºÙŠÙŠØ±Ø§Øª.</p>\\r\\n<p><strong>Ø§ØªØµÙ„ Ø¨Ù†Ø§</strong></p>\\r\\n<p>Ø¥Ø°Ø§ ÙƒØ§Ù†Øª Ù„Ø¯ÙŠÙƒ Ø£ÙŠ Ø£Ø³Ø¦Ù„Ø© Ø£Ùˆ Ø§Ø³ØªÙØ³Ø§Ø±Ø§Øª Ø¨Ø´Ø£Ù† Ø³ÙŠØ§Ø³Ø© Ø§Ù„Ø®ØµÙˆØµÙŠØ© Ù‡Ø°Ù‡ØŒ ÙŠØ±Ø¬Ù‰ Ø§Ù„Ø§ØªØµØ§Ù„ Ø¨Ù†Ø§:</p>\\r\\n<ul>\\r\\n<li>Ø¨Ø§Ù„Ø¨Ø±ÙŠØ¯ Ø§Ù„Ø¥Ù„ÙƒØªØ±ÙˆÙ†ÙŠ: <a href=\\\"mailto:support@pixelstrap.com\\\">support@pixelstrap.com</a></li>\\r\\n</ul>\",\"de\":\"<p><strong>Datenschutzerkl&auml;rung f&uuml;r den Taxi-Management-Service</strong></p>\\r\\n<p><strong>Erhebung und Verwendung von Informationen</strong></p>\\r\\n<p>Wir erheben pers&ouml;nliche Informationen, um unsere Taxi-Dienste bereitzustellen, zu personalisieren und zu verbessern. Diese Informationen k&ouml;nnen umfassen:</p>\\r\\n<ul>\\r\\n<li><strong>Pers&ouml;nliche Informationen</strong>: Name, E-Mail-Adresse, Telefonnummer, Postadresse und alle anderen Angaben, die Sie uns freiwillig zur Verf&uuml;gung stellen.</li>\\r\\n<li><strong>Zahlungsinformationen</strong>: Kreditkartennummern, Rechnungsadresse und Zahlungshistorie zur Bearbeitung Ihrer Fahrten.</li>\\r\\n<li><strong>Standortinformationen</strong>: Ihr aktueller Standort, einschlie&szlig;lich Abhol- und Zielorte, um die Fahrtzuordnung und Navigation zu erleichtern.</li>\\r\\n<li><strong>Verwendungsdaten</strong>: IP-Adresse, Ger&auml;tetyp, Browsertyp und App-Nutzungsdaten, um die Benutzererfahrung zu analysieren und zu verbessern.</li>\\r\\n<li><strong>Fahrtdaten</strong>: Details Ihrer Fahrten, wie Start- und Zielorte, Fahrtdauer, Fahrerinformationen und Bewertungen.</li>\\r\\n</ul>\\r\\n<p>Wir verwenden diese Daten, um:</p>\\r\\n<ul>\\r\\n<li>Mit Ihnen bez&uuml;glich Ihrer Buchungen, Werbeaktionen oder Service-Updates zu kommunizieren.</li>\\r\\n<li>Zahlungen zu verarbeiten und Ihre Fahrtanfragen zu verwalten.</li>\\r\\n<li>Die Servicequalit&auml;t zu verbessern, indem wir Muster in Fahrten, Feedback und Nutzerverhalten analysieren.</li>\\r\\n<li>Ihre Erfahrung mit ma&szlig;geschneiderten Empfehlungen oder Dienstleistungen zu personalisieren.</li>\\r\\n</ul>\\r\\n<p><strong>Weitergabe und Offenlegung von Daten</strong></p>\\r\\n<p>Wir verkaufen oder vermieten Ihre pers&ouml;nlichen Informationen nicht an Dritte. Wir k&ouml;nnen jedoch Ihre pers&ouml;nlichen Informationen an vertrauensw&uuml;rdige Drittanbieter weitergeben, um unsere Dienstleistungen bereitzustellen. Diese umfassen:</p>\\r\\n<ul>\\r\\n<li>Zahlungsabwickler: Zur sicheren Bearbeitung von Zahlungen.</li>\\r\\n<li>Fahrtzuordnungssysteme und Navigationsanbieter: Zur Gew&auml;hrleistung der effizientesten Fahrtzuordnung und Routenoptimierung.</li>\\r\\n<li>Kundensupport: Wir k&ouml;nnen Drittanbieter-Tools verwenden, um Ihnen Support-Dienste anzubieten.</li>\\r\\n</ul>\\r\\n<p>Alle Drittanbieter, mit denen wir zusammenarbeiten, sind vertraglich verpflichtet, Ihre pers&ouml;nlichen Informationen zu sch&uuml;tzen und diese nur f&uuml;r die Zwecke zu verwenden, f&uuml;r die sie weitergegeben wurden.</p>\\r\\n<p>Wir k&ouml;nnen Ihre Informationen auch offenlegen, wenn dies gesetzlich vorgeschrieben ist oder zum Schutz unserer Rechte, Eigentum oder Sicherheit oder der Rechte und Sicherheit unserer Nutzer und anderer Personen erforderlich ist.</p>\\r\\n<p><strong>Datensicherheit</strong></p>\\r\\n<p>Wir legen gro&szlig;en Wert auf die Sicherheit Ihrer pers&ouml;nlichen Informationen und wenden branchen&uuml;bliche Praktiken an, um sie vor unbefugtem Zugriff, Offenlegung, &Auml;nderung oder Zerst&ouml;rung zu sch&uuml;tzen. Unsere Sicherheitsma&szlig;nahmen umfassen:</p>\\r\\n<ul>\\r\\n<li><strong>Verschl&uuml;sselung</strong>: Wir verwenden Verschl&uuml;sselung, um sensible Zahlungs- und pers&ouml;nliche Daten zu sch&uuml;tzen.</li>\\r\\n<li><strong>Firewalls &amp; Zugriffskontrollen</strong>: Um unbefugten Zugriff auf unsere Systeme zu verhindern.</li>\\r\\n<li><strong>Sichere Transaktionen</strong>: Wir arbeiten mit vertrauensw&uuml;rdigen Drittanbietern f&uuml;r die Zahlungsabwicklung zusammen, um Finanztransaktionen sicher abzuwickeln.</li>\\r\\n</ul>\\r\\n<p>Dennoch m&ouml;chten wir Sie darauf hinweisen, dass keine &Uuml;bertragungsmethode &uuml;ber das Internet oder elektronische Speicherung v&ouml;llig sicher ist. W&auml;hrend wir erhebliche Vorsichtsma&szlig;nahmen treffen, um Ihre Daten zu sch&uuml;tzen, k&ouml;nnen wir keine absolute Sicherheit garantieren.</p>\\r\\n<p>Sie sind daf&uuml;r verantwortlich, die Vertraulichkeit Ihrer Kontoinformationen zu wahren und f&uuml;r alle Aktivit&auml;ten, die unter Ihrem Konto stattfinden.</p>\\r\\n<p><strong>Datenspeicherung</strong></p>\\r\\n<p>Wir werden Ihre pers&ouml;nlichen Informationen nur so lange aufbewahren, wie es notwendig ist, um Ihnen unsere Dienstleistungen bereitzustellen oder wie es gesetzlich vorgeschrieben ist. Sobald die Informationen nicht mehr f&uuml;r die in dieser Datenschutzerkl&auml;rung genannten Zwecke ben&ouml;tigt werden, werden wir diese sicher l&ouml;schen oder anonymisieren.</p>\\r\\n<p><strong>&Auml;nderungen der Richtlinie</strong></p>\\r\\n<p>Wir behalten uns das Recht vor, unsere Datenschutzerkl&auml;rung jederzeit zu aktualisieren oder zu &auml;ndern. &Auml;nderungen werden sofort nach der Ver&ouml;ffentlichung der &uuml;berarbeiteten Datenschutzerkl&auml;rung auf dieser Seite wirksam. Wir empfehlen Ihnen, diese Datenschutzerkl&auml;rung regelm&auml;&szlig;ig auf Aktualisierungen zu &uuml;berpr&uuml;fen. Die fortgesetzte Nutzung unserer Dienstleistungen nach &Auml;nderungen bedeutet, dass Sie diese &Auml;nderungen akzeptieren.</p>\\r\\n<p><strong>Kontaktieren Sie uns</strong></p>\\r\\n<p>Wenn Sie Fragen oder Bedenken zu dieser Datenschutzerkl&auml;rung haben, kontaktieren Sie uns bitte:</p>\\r\\n<ul>\\r\\n<li>Per E-Mail: <a href=\\\"mailto:support@pixelstrap.com\\\">support@pixelstrap.com</a></li>\\r\\n</ul>\",\"fr\":\"<p><strong>Politique de confidentialit&eacute; pour le service de gestion de taxi</strong></p>\\r\\n<p><strong>Collecte et utilisation des informations</strong></p>\\r\\n<p>Nous collectons des informations personnelles afin de fournir, personnaliser et am&eacute;liorer nos services de taxi. Ces informations peuvent inclure :</p>\\r\\n<ul>\\r\\n<li><strong>Informations personnelles</strong> : Nom, adresse e-mail, num&eacute;ro de t&eacute;l&eacute;phone, adresse postale et toutes autres informations que vous choisissez de nous fournir.</li>\\r\\n<li><strong>Informations de paiement</strong> : Num&eacute;ros de carte de cr&eacute;dit, adresse de facturation et historique des paiements pour le traitement de vos trajets.</li>\\r\\n<li><strong>Informations de localisation</strong> : Votre emplacement actuel, y compris les points de prise en charge et de d&eacute;pose, pour faciliter l\'appariement des trajets et la navigation.</li>\\r\\n<li><strong>Donn&eacute;es d\'utilisation</strong> : Adresse IP, type d\'appareil, type de navigateur et donn&eacute;es d\'utilisation de l\'application pour analyser et am&eacute;liorer l\'exp&eacute;rience utilisateur.</li>\\r\\n<li><strong>Informations sur les trajets</strong> : D&eacute;tails de vos trajets, tels que les lieux de d&eacute;part et d\'arriv&eacute;e, la dur&eacute;e du trajet, les informations sur le chauffeur et les &eacute;valuations.</li>\\r\\n</ul>\\r\\n<p>Nous utilisons ces donn&eacute;es pour :</p>\\r\\n<ul>\\r\\n<li>Communiquer avec vous concernant vos r&eacute;servations, promotions ou mises &agrave; jour des services.</li>\\r\\n<li>Traiter les paiements et g&eacute;rer vos demandes de trajets.</li>\\r\\n<li>Am&eacute;liorer la qualit&eacute; du service en analysant les tendances des trajets, les retours et le comportement des utilisateurs.</li>\\r\\n<li>Personnaliser votre exp&eacute;rience avec des recommandations ou des services sur mesure.</li>\\r\\n</ul>\\r\\n<p><strong>Partage et divulgation des donn&eacute;es</strong></p>\\r\\n<p>Nous ne vendons ni ne louons vos informations personnelles &agrave; des tiers. Cependant, nous pouvons partager vos informations personnelles avec des prestataires de services tiers de confiance dans le but de fournir nos services. Ceux-ci incluent :</p>\\r\\n<ul>\\r\\n<li>Processeurs de paiement : Pour traiter les paiements de mani&egrave;re s&eacute;curis&eacute;e.</li>\\r\\n<li>Syst&egrave;mes de jumelage de trajets et fournisseurs de navigation : Pour garantir l\'appariement des trajets le plus efficace et l\'optimisation des itin&eacute;raires.</li>\\r\\n<li>Support client : Nous pouvons utiliser des outils tiers pour vous fournir des services d\'assistance.</li>\\r\\n</ul>\\r\\n<p>Tous les tiers avec lesquels nous travaillons sont contractuellement oblig&eacute;s de prot&eacute;ger vos informations personnelles et de les utiliser uniquement aux fins pour lesquelles elles ont &eacute;t&eacute; partag&eacute;es.</p>\\r\\n<p>Nous pouvons &eacute;galement divulguer vos informations si la loi l\'exige ou pour prot&eacute;ger nos droits, biens ou s&eacute;curit&eacute;, ou les droits et la s&eacute;curit&eacute; de nos utilisateurs et d\'autres personnes.</p>\\r\\n<p><strong>S&eacute;curit&eacute; des donn&eacute;es</strong></p>\\r\\n<p>Nous accordons une grande importance &agrave; la s&eacute;curit&eacute; de vos informations personnelles et appliquons des pratiques conformes aux normes de l\'industrie pour les prot&eacute;ger contre tout acc&egrave;s non autoris&eacute;, divulgation, modification ou destruction. Nos mesures de s&eacute;curit&eacute; comprennent :</p>\\r\\n<ul>\\r\\n<li><strong>Cryptage</strong> : Nous utilisons le cryptage pour prot&eacute;ger les donn&eacute;es sensibles relatives aux paiements et aux informations personnelles.</li>\\r\\n<li><strong>Pare-feu et contr&ocirc;les d\'acc&egrave;s</strong> : Pour pr&eacute;venir tout acc&egrave;s non autoris&eacute; &agrave; nos syst&egrave;mes.</li>\\r\\n<li><strong>Transactions s&eacute;curis&eacute;es</strong> : Nous collaborons avec des processeurs de paiement de confiance pour garantir la s&eacute;curit&eacute; des transactions financi&egrave;res.</li>\\r\\n</ul>\\r\\n<p>Cependant, veuillez noter qu\'aucune m&eacute;thode de transmission sur Internet ou de stockage &eacute;lectronique n\'est totalement s&eacute;curis&eacute;e. Bien que nous prenions des pr&eacute;cautions importantes pour prot&eacute;ger vos donn&eacute;es, nous ne pouvons pas garantir une s&eacute;curit&eacute; absolue.</p>\\r\\n<p>Vous &ecirc;tes responsable de la confidentialit&eacute; de vos identifiants de compte et de toutes les activit&eacute;s qui se d&eacute;roulent sous votre compte.</p>\\r\\n<p><strong>Conservation des donn&eacute;es</strong></p>\\r\\n<p>Nous conserverons vos informations personnelles uniquement pendant le temps n&eacute;cessaire pour vous fournir nos services ou selon ce qui est requis par la loi. Une fois que les informations ne sont plus n&eacute;cessaires aux fins &eacute;nonc&eacute;es dans cette politique de confidentialit&eacute;, nous les supprimerons ou les anonymiserons de mani&egrave;re s&eacute;curis&eacute;e.</p>\\r\\n<p><strong>Mises &agrave; jour de la politique</strong></p>\\r\\n<p>Nous nous r&eacute;servons le droit de mettre &agrave; jour ou de modifier cette politique de confidentialit&eacute; &agrave; tout moment. Les modifications prendront effet imm&eacute;diatement apr&egrave;s la publication de la politique de confidentialit&eacute; r&eacute;vis&eacute;e sur cette page. Nous vous encourageons &agrave; consulter p&eacute;riodiquement cette politique de confidentialit&eacute; pour prendre connaissance des mises &agrave; jour. L\'utilisation continue de nos services apr&egrave;s toute modification signifie que vous acceptez ces changements.</p>\\r\\n<p><strong>Contactez-nous</strong></p>\\r\\n<p>Si vous avez des questions ou des pr&eacute;occupations concernant cette politique de confidentialit&eacute;, veuillez nous contacter :</p>\\r\\n<ul>\\r\\n<li>Par e-mail : <a href=\\\"mailto:support@pixelstrap.com\\\">support@pixelstrap.com</a></li>\\r\\n</ul>\"}', NULL, NULL, NULL, 1, 1, '2025-01-24 02:56:38', '2025-01-24 03:04:47', NULL);
