INSERT INTO `rental_vehicles` (`id`, `name`, `description`, `vehicle_type_id`, `normal_image_id`, `front_view_id`, `side_view_id`, `boot_view_id`, `interior_image_id`, `vehicle_per_day_price`, `allow_with_driver`, `driver_per_day_charge`, `vehicle_subtype`, `fuel_type`, `gear_type`, `vehicle_speed`, `mileage`, `interior`, `driver_id`, `status`, `is_ac`, `bag_count`, `verified_status`, `registration_no`, `registration_image_id`, `created_by_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, '{\"en\":\"Hyundai Verna\"}', '{\"en\":\"The Verna is a good option for those who want the ease of driving, futuristic, and a feature-packed sedan. Highlights include the cabin experience, practicality, comfort, and boot space. However, the turbo engine is certainly not a perfect pick, it does offer an attractive combination of executive comfort and driving joy.\"}', 4, 396, 394, 398, 390, 392, '80.00', 1, '20.00', 'Sedan', 'Petrol', 'Manual / Automatic', '120 km/h', '18.6 - 20.6 kmpl', 'Air Purifier,Sunroof,Cup Holders,Powered driver seat,Heated and ventilated seats', 21, 1, 1, 0, 'approved', 'GH6734FF', 400, 1, '2025-01-24 00:50:00', '2025-01-24 01:32:16', NULL),
(2, '{\"en\":\"Maruti Dzire\"}', '{\"en\":\"The Maruti Dzire is a subcompact sedan that offers comfort and practicality of a sedan at the price of a hatchback. The Dzire 2024 features a new Z-series petrol engine, which is borrowed from the Swift, and it is also available with an optional CNG powertrain. Since its launch, the Dzire has been the top-selling subcompact sedan in India.\"}', 4, 338, 334, 332, 336, 331, '50.00', 1, '20.00', 'Sedan', 'Petrol / CNG', 'Manual / Automatic', '100 km/h', '24.79 - 25.71 kmpl', 'Parking Sensors,Cup Holders,Rear AC Vents,360-degree camera,9-inch touchscreen', 17, 1, 1, 0, 'approved', 'MH01CD5678', 400, 1, '2025-01-24 01:19:09', '2025-01-24 01:19:09', NULL),
(3, '{\"en\":\"Hyundai Aura\"}', '{\"en\":\"The Hyundai Aura is an entry-level, subcompact sedan that offers a good blend of comfort and convenience features while being equipped with the necessary safety kit. It comes with a petrol engine which can be paired with both manual and automatic options, and also gets a choice of a factory-fitted CNG kit.\"}', 4, 341, 342, 345, 348, 346, '35.00', 1, '20.00', 'CNG,Sedan', 'Petrol', 'Manual', '100 km/h', '65 Litres', 'Wireless Charger,Android Auto/Apple CarPlay,Automatic Climate Control,Parking Sensors,Engine Start/Stop Button', 18, 1, 1, 0, 'approved', 'KA03EF9123', 400, 1, '2025-01-24 01:24:30', '2025-01-24 01:24:30', NULL),
(4, '{\"en\":\"Honda City\"}', '{\"en\":\"The Honda City has a striking exterior that gives it quite a sporty look, while its interior has an elegant look and has best-in-segment quality. Both the cabin and the ride offered by the car are comfortable, with the knee room of rear seats similar to the cars in the segments above.\"}', 4, 358, 350, 357, 354, 352, '30.00', 1, '20.00', 'Sedan', 'Petrol', 'Manual / Automatic', '80 km/h', '17.8 - 18.4 kmpl', 'Height Adjustable Driver Seat,Tyre Pressure Monitor,Wireless Charger,Android Auto/Apple CarPlay,Voice Commands', 19, 1, 1, 0, 'approved', 'GH6734FF', 400, 1, '2025-01-24 01:31:40', '2025-01-24 01:31:40', NULL),
(5, '{\"en\":\"Tata Tigor\"}', '{\"en\":\"The Tata Tigor is an entry-level sedan that has been refreshed with several updates over the years. The sub-4m sedan stands out for its safety features and offers everything you\'d expect at its price point. It comes with multiple powertrain options including petrol, CNG and even an EV version, with an AMT automatic option available for the CNG variants as well.\"}', 4, 362, 364, 360, 366, 368, '30.00', 1, '15.00', 'Sedan', 'CNG / Petrol', 'Manual / Automatic', '100 km/h', '15 km/ltr', '8-speaker sound system,Advanced Internet Features,Parking Sensors,Engine Start/Stop Button,Automatic Climate Control', 23, 1, 1, 0, 'approved', 'GJ05AB1234', 400, 1, '2025-01-24 01:46:33', '2025-01-24 01:46:33', NULL),
(6, '{\"en\":\"Honda Amaze\"}', '{\"en\":\"The Honda Amaze is a subcompact sedan that combines Honda\'s trusted brand value with elegant design, inside and out. Powered by a 90 PS 1.2-litre naturally aspirated petrol engine, it stands as the most powerful car in its segment. The Amaze is the only subcompact sedan in India equipped with ADAS.\"}', 4, 375, 374, 370, 376, 378, '35.00', 1, '12.00', 'Sedan', 'Petrol', 'Manual / Automatic', '80 km/h', '18.65 - 19.46 kmpl', 'Rear AC Vents,Engine Start/Stop Button,Cup Holders,Parking Sensors,Advanced Internet Features', 21, 1, 1, 0, 'approved', 'DL05GH1234', 400, 1, '2025-01-24 01:51:00', '2025-01-24 01:51:00', NULL),
(7, '{\"en\":\"Maruti Ciaz\"}', '{\"en\":\"The Maruti Ciaz is a compact sedan that is known for its affordability and comfort. It has a claimed mileage of up to 20.65 kmpl which also makes it a great choice for buyers seeking fuel efficiency. It offers good space for five passengers and makes for a practical, comfortable and value-for-money city car.\"}', 4, 388, 385, 384, 386, 380, '56.00', 1, '20.00', 'Sedan', 'Petrol', 'Manual / Automatic', '80 km/h', '20.04 - 20.65 kmpl', 'Rear AC Vents,Air Purifier,Voice Commands,multi-info display,LED projector headlamps', 23, 1, 1, 0, 'approved', 'TN07HI5678', 400, 1, '2025-01-24 01:54:57', '2025-01-24 01:54:57', NULL),
(8, '{\"en\":\"Maruti Swift\"}', '{\"en\":\"The Maruti Swift is a midsize hatchback in India which offers a good balance of features, performance, and fuel efficiency. It is available with Suzukiâ€™s new 1.2-litre Z series 3- cylinder petrol engine in both 5-speed manual or 5-speed AMT transmission. The Swift is now also available in CNG offering a claimed fuel efficiency of 32.85 km/kg.\"}', 3, 412, 410, 414, 418, 416, '37.00', 1, '12.00', 'Sedan', 'CNG / Petrol', 'Manual / Automatic', '80 km/h', '24.8 - 25.75 kmpl', 'Engine Start/Stop Button,Rear AC Vents,Rear Camera,9-inch touchscreen,9-inch touchscreen', 34, 1, 1, 0, 'approved', 'DL05GH1234', 400, 1, '2025-01-24 02:11:46', '2025-01-24 02:11:46', NULL),
(9, '{\"en\":\"Maruti Baleno\"}', '{\"en\":\"The current-spec facelifted Baleno has added a lot of modern styling elements and features like a 360-degree camera and a head-up display (HUD). The ride quality is also improved in comparison to the pre-facelift model. The comfortable seats, the smooth engine, along with the pricing it comes at, make the Baleno a choiceable option for individuals and small families.\"}', 3, 426, 422, 425, 428, 420, '45.00', 1, '20.00', 'hatchback', 'Petrol / CNG', 'Manual / Automatic', '80 km/h', '22.35 - 22.94 kmpl', '360 Degree Camera,Heads-up Display,9-inch SmartPlay Pro Infotainment System,Android Auto/Apple CarPlay', 33, 1, 1, 0, 'approved', 'GJ05AB1234', 400, 1, '2025-01-24 02:18:08', '2025-01-24 02:18:08', NULL),
(10, '{\"en\":\"Tata Tiago\"}', '{\"en\":\"The Tata Tiago presents a compelling option for those in the market for a budget-friendly hatchback. With its new CNG AMT variants, a variety of features, and good fuel efficiency\"}', 3, 435, 438, 436, 430, 432, '23.00', 1, '15.00', 'hatchback', 'CNG / Petrol', 'Manual / Automatic', '80 km/h', '19 - 20.09 kmpl', 'Keyless Entry,Air Conditioner,Android Auto/Apple CarPlay,Rear Camera,Power Windows', 32, 1, 1, 0, 'approved', 'DL05GH1234', 400, 1, '2025-01-24 02:30:38', '2025-01-24 02:30:38', NULL),
(11, '{\"en\":\"Citroen C3\"}', '{\"en\":\"Passenger safety is taken care of by up to six airbags, ABS with EBD, and a rear camera with parking sensors. The turbo variants of the C3 also get electronic stability program (ESP), hill-hold assist, and a tyre pressure monitoring system (TPMS).\"}', 3, 446, 448, 444, 440, 442, '32.00', 1, '12.00', 'hatchback', 'CNG / Petrol', 'Automatic / Manual', '80 km/h', '19.3 kmpl', 'Practical storage spaces,Mobile dock with wire organizer,10.25-inch infotainment screen', 31, 1, 1, 0, 'approved', 'DL05GH1234', 400, 1, '2025-01-24 02:37:07', '2025-01-24 02:37:07', NULL),
(12, '{\"en\":\"Maruti Ignis\"}', '{\"en\":\"The Maruti Suzuki Ignis is a comfortable, spacious and feature-loaded hatchback for a small family. Though, the interior lacks the finesse in quality, it\'s a practical and efficient car that stands out in a crowd too.\"}', 3, 460, 468, 466, 464, 462, '36.00', 1, '10.00', 'hatchback', 'Petrol', 'Manual / Automatic', '80 km/h', '20.89 kmpl', 'Power Windows,Dual airbags,roof wraps,LED projector headlamps', 30, 1, 1, 0, 'approved', 'DL05GH1234', 400, 1, '2025-01-24 02:47:14', '2025-01-24 02:47:14', NULL),
(13, '{\"en\":\"Maruti Wagon R\"}', '{\"en\":\"Maruti Wagon R has features such as 7-inch infotainment, a 4-speaker sound system, steering-mounted audio controls and remote keyless entry.\"}', 3, 472, 474, 478, 476, 470, '26.00', 1, '20.00', 'hatchback', 'Petrol / CNG', 'Manual / Automatic', '75 km/h', '23.56 - 25.19 kmpl', 'Keyless Entry,Bluetooth Connectivity,Bluetooth Connectivity', 28, 1, 1, 0, 'approved', 'GJ05AB1234', 400, 1, '2025-01-24 02:54:31', '2025-01-24 02:54:31', NULL),
(14, '{\"en\":\"Honda Shine\"}', '{\"en\":\"The Honda Shine 125 comes equipped with a silent start system, side stand engine cut-off, an engine kill switch and alloy wheels. The dual pod analogue instrument console of the Honda Shine includes a speedometer, odometer, fuel gauge, and tell-tale lights.\"}', 1, 490, 492, 498, 554, 556, '22.00', 1, '10.00', 'bike', 'Petrol', 'Manual', '45 km/h', '55 kmpl', 'Engine Combi Brake System,Odometer Analogue,Fuel gauge', 29, 1, 1, 0, 'approved', 'DL05GH1234', 400, 1, '2025-01-24 03:16:49', '2025-01-24 03:16:49', NULL),
(15, '{\"en\":\"Honda Activa 125\"}', '{\"en\":\"The 2025 Honda Activa 125 gets a new headlight and tons of features with the addition of a new 4.2-inch TFT display making it a great choice for a family oriented scooter.\"}', 1, 526, 528, 522, 524, 520, '12.00', 1, '7.00', 'bike', 'Petrol', 'Automatic', '60 km/h', '19 km/ltr', 'Seat Opening Switch,Speedometer Digital,Odometer Digital,External Fuel Filling', 26, 1, 1, 0, 'approved', 'KA03EF9123', 400, 1, '2025-01-24 03:20:30', '2025-01-24 03:20:30', NULL),
(16, '{\"en\":\"TVS Raider\"}', '{\"en\":\"TVS Raider stands out in the 125cc segment with its sporty design, advanced features, and reliable performance. Ideal for city riding. It gets a fully digital instrument cluster, and segment-first under-seat storage. The Raider 125 combines style, comfort, and efficiency, making it a top choice in its class.\"}', 1, 500, 508, 502, 506, 504, '17.00', 1, '5.00', 'bike', 'Petrol', 'Manual', '60 km/h', '15 km/ltr', 'Engine Synchronized Braking System,DRLs,Tripmeter Digital', 25, 1, 1, 0, 'approved', 'GJ05AB1234', 400, 1, '2025-01-24 03:23:12', '2025-01-24 03:23:12', NULL),
(17, '{\"en\":\"Honda SP125\"}', '{\"en\":\"The Honda SP125 is a sporty 125cc commuter from the Japanese manufacturer which now gets improved styling and an extensive features list for the 2025 iteration.\"}', 1, 556, 551, 558, 554, 552, '18.00', 1, '7.00', 'bike', 'Petrol', 'Manual', '50 km/h', '19 km/ltr', 'Navigation,Mobile Connectivity Bluetooth,Odometer Digital', 20, 1, 1, 0, 'approved', 'MH01CD5678', 400, 1, '2025-01-24 03:27:31', '2025-01-24 03:27:31', NULL);
